import React from "react";
import "./stylecss.css";

export default function About(){
    return(
        <div className="text-white text-lg">
            <p>As a software engineer, I'm passionate about creating beautiful products. In my downtime, I love <br></br> constructing projects and exploring the latest in tech.</p>
            <br/>
            <p>I've honed my skills in building performant, scalable web apps using tools like Next.js, Svelte-kit, Typescript and their ecosystem. I'm also well-versed in full-stack development with Node, Express, and both SQL and NoSQL databases. For more details, feel free to check out my resume.</p>
            <br></br>
            <p>Currently, I'm diving into exciting areas like Go, Framer Motion, and Generative AI.</p>
            <br/>
            <p>I'm always open to working on intriguing projects. If you've got something in mind, let's chat.</p> <br />
        </div>
    )
}
